  return (
    <div className='exercises'>
      <h1>Exercises</h1>


      <Button variant="contained" color="primary"> Primary </Button>

    </div>
  )
}

function ShowExercises() {
  return (
    <div className='exercises'>
      <h1>Exercises</h1>
    </div>
  )
}

export { AddExercise, ShowExercises }
